import React from "react";
import ReactDOM from "react-dom";
import Sdata from "./Sdata";
import Card from "./Card";

ReactDOM.render(
    <>
    <h1> Top 5 Best Netflix Series in 2020</h1> 
    {Sdata.map((val) => {
        <Card 
         imgsrc ={val.imgscr}
         title ={val.title}
         sname ={val.sname}
         link = {val.link}
    />
    })}



    <Card 
          imgsrc ={Sdata[1].imgscr}
         title ={Sdata[1].title}
         sname ={Sdata[1].sname}
         link = {Sdata[1].link}
     />

    <Card 
          imgsrc ={Sdata[2].imgscr}
         title ={Sdata[2].title}
         sname ={Sdata[2].sname}
         link = {Sdata[2].link}
    />

    </>,
    document.getElementById("root")
);
